import React from "react";
import "./App.css";
import Header from "./components/header";

function App() {
  return (
    <div className="main">
      <Header />
      <div className="body">
        <div className="left">
          <section className="about">
            <article>
              <h2>About Me</h2>
              <p>
                Salut c'est moi !
              </p>
            </article>
          </section>

          <section className="projects">
            <h2>Mes projets</h2>
            <article>
              <h3>Bataille navale</h3>
              <img src="./assets/navy.png "alt="slug" style={{width: "200px", height: "200px"}}/>
            </article>
            </section>
          </div>
      </div>
    </div>
  );
}

export default App;
